1. Any and all rough notes of witness interviews taken or obtained in any investigation of Ms. Maxwell, including federal, state, local and other investigations whether or not the contents thereof have been incorporated in official reports;

2. Any notes or memoranda made by government counsel, staff, or law enforcement agents during the interview of any witness intended to be called by the government in its direct case;

3. Any emails, texts or voicemails (in original, transcribed and summary form) from the witness and from the witness's counsel/law firm containing information derived from any witness intended to be called by the government in its direct case; and

4. Any emails, texts or voicemails (in original, transcribed and summary form) between and among government counsel and law enforcement officers containing information derived from any witness intended to be called by the government in its direct case.
